import React, { useState } from 'react';
import { GoogleMap, useJsApiLoader, Marker, InfoWindow } from '@react-google-maps/api';
import axios from 'axios'
import Button from '@mui/material/Button';
import './GoogleMaps.css';

const containerStyle = {
    width: '100%',
    height: '100vh',
};

function MapComponent() {
    const { isLoaded } = useJsApiLoader({
        id: 'google-map-script',
        googleMapsApiKey: "AIzaSyCuqNmuK8YHJn06WZwIkzZd2J8_XTJxpxM"
    });

    const [position, setPosition] = useState({ lat: 0, lng: 0 });
    const mapRef = React.useRef(null);
    const [waypoints, setWayPoints] = React.useState([]);
    const [foundWaypoints, setfoundWaypoints] = React.useState([]);
    const [currPositionClicked, setCurrPositionClicked] = React.useState(false);
    const [activeMarkerHash, setActiveMarkerHash] = React.useState(null);

    navigator.geolocation.getCurrentPosition((position) => {
        setPosition({ lat: position.coords.latitude, lng: position.coords.longitude });
    });

    async function getWaypoints(bounds) {
        let boundaries = {
            northEastLat: bounds.getNorthEast().lat(),
            northEastLng: bounds.getNorthEast().lng(),
            southWestLat: bounds.getSouthWest().lat(),
            southWestLng: bounds.getSouthWest().lng()
        }

        await axios.get(`http://localhost:5000/geocacheWaypoints/${boundaries.northEastLat}/${boundaries.northEastLng}/${boundaries.southWestLat}/${boundaries.southWestLng}`).then(response => {
            console.log("SUCCESSGET", response)
            setWayPoints(response.data.message);
        }).catch(error => {
            console.log(error)
        })
    };

    async function getFoundWaypoints() {
        await axios.get('http://localhost:5000/geocacheFoundWaypoints').then(response => {
            console.log("SUCCESSGETHERE", response.data.message)
            setfoundWaypoints(response.data.message);
        }).catch(error => {
            console.log(error)
        })
    };

    const onTilesLoaded = React.useCallback(async function callback() {
        const bounds = mapRef.current.getBounds();
        await getWaypoints(bounds);
        await getFoundWaypoints();
    }, [])

    const onLoad = React.useCallback(async function callback(map) {
        const bounds = new window.google.maps.LatLngBounds(position);
        await getWaypoints(bounds);
        await getFoundWaypoints();

        map.fitBounds(bounds);
        mapRef.current = map;
        map.center = position;
    }, [position])

    const onUnmount = React.useCallback(function callback() {
        mapRef.current = null;
        setWayPoints([]);
        setCurrPositionClicked(false);
        setActiveMarkerHash(null);
    }, [])

    // function displayMarkers() {

    //     return <div>

    //         {waypoints.map(waypoint => {
    //             return <Marker position={{ lat: waypoint.lat, lng: waypoint.lng }} clickable={true}
    //                 onClick={() => setActiveMarkerHash(waypoint.hash)}>
    //                 {activeMarkerHash && activeMarkerHash === waypoint.hash ? (
    //                     <InfoWindow onCloseClick={() => setActiveMarkerHash(null)}>
    //                         <div>
    //                             {console.log(activeMarkerHash)}
    //                             {console.log(waypoint.hash)}
    //                             <div>{waypoint.name}</div>
    //                             <div>Latitude: {waypoint.lat}</div>
    //                             <div>Longitude: {waypoint.lng}</div>
    //                         </div>
    //                     </InfoWindow>
    //                 ) : null}
    //             </Marker>
    //         })}
    //     </div>;
    // }


    // const onMarkerClick = React.useCallback(async function callback(waypoint) {
    //     setActiveMarkerHash(waypoint.hash);
    // }, []);

    const onCacheFoundButtonClick = React.useCallback(async function callback(waypoint) {
        let waypointName = waypoint.name.replace('/', '@@');

        await axios.post(`http://localhost:5000/geocacheFound/${waypoint.lat}/${waypoint.lng}/'${waypointName}'/${waypoint.hash}`).then(response => {
            console.log("SUCCESSPOST", response)
        }).catch(error => {
            console.log(error)
        })

        await getFoundWaypoints();
    }, []);

    const currPositionIcon = {
        path: "M-1.547 12l6.563-6.609-1.406-1.406-5.156 5.203-2.063-2.109-1.406 1.406zM0 0q2.906 0 4.945 2.039t2.039 4.945q0 1.453-0.727 3.328t-1.758 3.516-2.039 3.070-1.711 2.273l-0.75 0.797q-0.281-0.328-0.75-0.867t-1.688-2.156-2.133-3.141-1.664-3.445-0.75-3.375q0-2.906 2.039-4.945t4.945-2.039z",
        fillColor: "green",
        fillOpacity: 1,
        strokeWeight: 0,
        rotation: 0,
        scale: 2,
    };

    function displayMarkers() {
        let foundCacheHash = [];
        foundWaypoints.map(waypoint => { foundCacheHash.push(waypoint.hash) });

        return <div>

            {waypoints.map(waypoint => {
                foundCacheHash.includes(waypoint.hash) ?
                    (
                        <Marker position={{ lat: waypoint.lat, lng: waypoint.lng }} clickable={true}
                            onClick={() => setActiveMarkerHash(waypoint.hash)} >
                            {activeMarkerHash && activeMarkerHash === waypoint.hash ? (
                                <InfoWindow onCloseClick={() => setActiveMarkerHash(null)}>
                                    <div>
                                        {console.log(activeMarkerHash)}
                                        {console.log(waypoint.hash)}
                                        <div>{waypoint.name}</div>
                                        <div>Latitude: {waypoint.lat}</div>
                                        <div>Longitude: {waypoint.lng}</div>
                                    </div>
                                </InfoWindow>
                            ) : null}
                        </Marker>

                    ) :
                    (<Marker position={{ lat: waypoint.lat, lng: waypoint.lng }} clickable={true}
                        onClick={() => setActiveMarkerHash(waypoint.hash)}>
                        {activeMarkerHash && activeMarkerHash === waypoint.hash ? (
                            <InfoWindow onCloseClick={() => setActiveMarkerHash(null)}>
                                <div>
                                    {console.log(activeMarkerHash)}
                                    {console.log(waypoint.hash)}
                                    <div>{waypoint.name}</div>
                                    <div>Latitude: {waypoint.lat}</div>
                                    <div>Longitude: {waypoint.lng}</div>
                                </div>
                            </InfoWindow>
                        ) : null}
                    </Marker>)

            })}
        </div>;
    }

    function isFoundMarker(hash) {
        let foundCacheHash = [];
        foundWaypoints.map(waypoint => { foundCacheHash.push(waypoint.hash) });
        console.log(foundWaypoints)
        console.log(hash)
        //console.log(foundCacheHash)
        return foundCacheHash.includes(hash);
    }

    let foundWaypointIcon = {
        url: "http://maps.google.com/mapfiles/ms/icons/blue-dot.png",
        fillColor: "red",
        fillOpacity: 1,
        strokeWeight: 0,
        rotation: 0,
        scale: 1.8
    }

    return isLoaded ? (
        <GoogleMap
            mapContainerStyle={containerStyle}
            zoom={4}
            onLoad={onLoad}
            onUnmount={onUnmount}
            onTilesLoaded={onTilesLoaded}
        >
            {waypoints.map(waypoint => {
                return <Marker position={{ lat: waypoint.lat, lng: waypoint.lng }} clickable={true}
                    onClick={() => setActiveMarkerHash(waypoint.hash)} icon={isFoundMarker(waypoint.hash) ? foundWaypointIcon : null}>
                    {activeMarkerHash && activeMarkerHash === waypoint.hash ? (
                        <InfoWindow onCloseClick={() => setActiveMarkerHash(null)}>
                            <div id="markerInfo">
                                {console.log(activeMarkerHash)}
                                {console.log(waypoint.hash)}
                                <div id="markerName">{waypoint.name}</div>
                                <div>Latitude: {waypoint.lat}</div>
                                <div>Longitude: {waypoint.lng}</div>
                                <Button id="markerButton" variant="outlined" onClick={() => onCacheFoundButtonClick(waypoint)}>Cache found!</Button>
                            </div>
                        </InfoWindow>
                    ) : null}
                </Marker>
            })}
            {<Marker position={position} clickable={true} icon={currPositionIcon} onClick={() => setCurrPositionClicked(true)} >
                {currPositionClicked && (
                    <InfoWindow onCloseClick={() => setCurrPositionClicked(false)}>
                        <div>
                            <span>Current Location!</span>
                            <div>Latitude: {position.lat}</div>
                            <div>Longitude: {position.lng}</div>
                        </div>
                    </InfoWindow>
                )}
            </Marker>}
        </GoogleMap>
    ) : <></>
}

export default React.memo(MapComponent)
